function App() {
  return (
     <Router>
          <div>
        <Routes>
        <Route path="/auth/userlogin" element={<UserAuthForm action="User Sign Up" />} />
        <Route path="/auth/adminlogin" element={<AdminAuthForm action="Admin Sign Up" />} />
        </Routes>
    </div>
     </Router>
  );
}

export default App;
